# Let&#x27;s assign gematria dict
gematria = {&#x27;א&#x27;:1,&#x27;ב&#x27;:2,&#x27;ג&#x27;:3,&#x27;ד&#x27;:4,&#x27;ה&#x27;:5,&#x27;ו&#x27;:6,&#x27;ז&#x27;:7,&#x27;ח&#x27;:8,&#x27;ט&#x27;:9,
            &#x27;י&#x27;:10,&#x27;כ&#x27;:20,&#x27;ך&#x27;:20,&#x27;ל&#x27;:30,&#x27;מ&#x27;:40,&#x27;ם&#x27;:40,&#x27;נ&#x27;:50,&#x27;ן&#x27;:50,&#x27;ס&#x27;:60,
            &#x27;ע&#x27;:70,&#x27;פ&#x27;:80,&#x27;ף&#x27;:80,&#x27;צ&#x27;:90,&#x27;ץ&#x27;:90,&#x27;ק&#x27;:100,&#x27;ר&#x27;:200,&#x27;ש&#x27;:300,&#x27;ת&#x27;:400}
def gematria_value(word):
    return sum(gematria[ch] for ch in word if ch in gematria)

brooke = &quot;ברוק&quot;
lynn = &quot;לין&quot;
rainer = &quot;ריינר&quot;
print(gematria_value(brooke), gematria_value(lynn), gematria_value(rainer), gematria_value(brooke)+gematria_value(lynn)+gematria_value(rainer))

